import React from "react";
import { Link } from "react-router-dom";

export default function Navbar() {
  const styles = {
    nav: {
      display: "flex",
      justifyContent: "space-around",
      alignItems: "center",
      backgroundColor: "#333",
      padding: "10px 0"
    },
    link: {
      color: "#fff",
      textDecoration: "none",
      fontSize: "16px",
      padding: "8px 12px",
      borderRadius: "4px",
      transition: "background 0.3s"
    },
    linkHover: {
      backgroundColor: "#555"
    }
  };

  return (
    <nav style={styles.nav}>
      <Link to="/" style={styles.link}>Tournament</Link>
      <Link to="/team" style={styles.link}>Team</Link>
      <Link to="/player" style={styles.link}>Player</Link>
      <Link to="/match" style={styles.link}>Match</Link>
    </nav>
  );
}
